import React from 'react'
import { Link } from 'react-router-dom'

const CollectionItem = ({art}) => {
  return(
    <div className="card z-depth-0 white">

      <Link to={`${art.authorId}`}>
        <img
          src={art.imageUrl}
          alt="your collection"
          className="responsive-img"/>
      </Link>
    </div>
  )
}

export default CollectionItem
